/** by startOffset then endOffset */
int compareOffsets(TokenLL tokenB) {
  int cmp = Integer.compare(this.startOffset, tokenB.startOffset);
  if (cmp == 0) {
    cmp = Integer.compare(this.endOffset, tokenB.endOffset);
  }
  return cmp;
}

